import React, { useState, useEffect } from "react";
import {
  Card,
  CardHeader,
  CardBody,
  CardFooter,
  Flex,
  Heading,
  Box,
  Text,
  Container,
  Button,
} from "@chakra-ui/react";
function App() {
  const [questions, setQuestions] = useState([]);
  const [userAnswers, setUserAnswers] = useState([]);
  const [score, setScore] = useState(0);
  const [showResult, setShowResult] = useState(false);

  useEffect(() => {
    generateQuestions();
  }, []);

  const generateQuestions = () => {
    fetch("http://localhost:8000/api/generate/")
      .then((response) => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        return response.json();
      })
      .then((data) => setQuestions(data))
      .catch((error) => {
        console.error("Error:", error);
        setQuestions([]);
      });
  };

  const handleAnswerSelect = (questionId, selectedChoice) => {
    const answer = { question_id: questionId, selected_choice: selectedChoice };
    setUserAnswers((prevAnswers) => [...prevAnswers, answer]);

    const question = questions.find((q) => q.id === questionId);
    const isCorrect = selectedChoice === question.correct_choice;

    if (isCorrect) {
      console.log("Correct answer!");

      alert("Corect Answer");
    } else {
      alert("Wrong Answer");
    }
  };

  const submitAnswers = () => {
    fetch("http://localhost:8000/api/submit/", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ user_answers: userAnswers }),
    })
      .then((response) => {
        if (!response.ok) {
          throw new Error("Network response was not ok");
        }
        return response.json();
      })
      .then((data) => {
        setScore(data.score);
        setShowResult(true);
      })
      .catch((error) => {
        console.error("Error:", error);
        setScore(0);
        setShowResult(true);
      });
  };

  return (
    <div className="App">
      <Heading mt={5}>Random Question Generator</Heading>
      {showResult ? (
        <div>
          <h2>Result</h2>
          <p>
            Score: {score} / {questions.length}
          </p>
        </div>
      ) : (
        <Box>
          <Flex
            alignItems={"center"}
            justifyContent={"space-between"}
            wrap={"wrap"}
          >
            {questions.map((question) => (
              <Container key={question.id}>
                <Card mt={10} mb={10}>
                  <CardHeader>
                    <Heading size="md">{question.question_text}</Heading>
                  </CardHeader>

                  <CardBody>
                    <Flex
                      align={"center"}
                      justifyContent={"space-between"}
                      spacing="4"
                    >
                      <Box mb={5}>
                        <Button
                          onClick={() =>
                            handleAnswerSelect(question.id, question.choice1)
                          }
                        >
                          1 {question.choice1}
                        </Button>
                      </Box>
                      <Box mb={5}>
                        <Button
                          onClick={() =>
                            handleAnswerSelect(question.id, question.choice2)
                          }
                        >
                          2 {question.choice2}
                        </Button>
                      </Box>
                    </Flex>
                    <Flex
                      align={"center"}
                      justifyContent={"space-between"}
                      spacing="4"
                    >
                      <Box mb={5}>
                        <Button
                          onClick={() =>
                            handleAnswerSelect(question.id, question.choice3)
                          }
                        >
                          3 {question.choice3}
                        </Button>
                      </Box>
                      <Box mb={5}>
                        <Button
                          onClick={() =>
                            handleAnswerSelect(question.id, question.choice4)
                          }
                        >
                          4 {question.choice4}
                        </Button>
                      </Box>
                    </Flex>
                  </CardBody>
                </Card>
              </Container>
            ))}
          </Flex>
          <Button onClick={submitAnswers}>Submit</Button>
        </Box>
      )}
    </div>
  );
}

export default App;
